Каким образом следует попытаться остановить кровотечение, если оно не останавливается после наложения давящей повязки?
А - сдавить кровеносные сосуды, питающие раненую область, пальцами;
Б - сдавить кровеносные сосуды, питающие раненую область, жгутом или закруткой;
В - согнуть конечности в суставах.

Каковы признаки эффективности массажа сердца (кроме появления пульса)? В вариантах ответа обозначено:
А - уменьшение синюшности кожи и слизистых оболочек;
Б - расширение зрачков;
В - сужение зрачков;
Г - появление самостоятельного дыхания.
